import Categorie from './Categorie';
import React, { useState } from 'react';
import { useHistory } from "react-router-dom";
import { useDispatch } from 'react-redux';
import axios from 'axios';
import { LOGIN_SUCCESS,GET_TICKETS_SUCCESS, REGISTER_SUCCESS } from '../types';

function Sinscrire() {
  const [nom, setnom] = useState("");
  const [password, setpassword] = useState("");
  const [pseudo, setpseudo] = useState("");
  const [prenom, setprenom] = useState("");
  const [cin, setcin] = useState("");
  const [adresse, setadresse] = useState("");
  const [telephone, settelephone] = useState("");
  const [codePostal, setcodePostal] = useState("");
  const [sexe, setsexe] = useState("");
  const [email, setemail] = useState("");

  const handlenom = (e) => {
    setnom(e.target.value)
  }

  const handleEmail = (e) => {
    setEmail(e.target.value)
  }

  const handlepassword = (e) => {
    setpassword(e.target.value)
  }

  const handlepseudo = (e) => {
    setpseudo(e.target.value)
  }

  const handleprenom = (e) => {
    setprenom(e.target.value)
  }

  const handlecin = (e) => {
    setcin(e.target.value)
  }

  const handleadresse = (e) => {
    setadresse(e.target.value)
  }

  const handletelephone = (e) => {
    settelephone(e.target.value)
  }

  const handlecodePostal = (e) => {
    setcodePostal(e.target.value)
  }

  const handlesexe = (e) => {
    setsexe(e.target.value)
  }

  const handleemail = (e) => {
    setemail(e.target.value)
  }


  const handleSubmit = async () => {

    let data = {
      nom : nom,
      prenom :prenom ,
      password : password,
      email : email,
      pseudo :pseudo ,
      sexe : sexe,
      codePostal : codePostal,
      cin : cin,
      telephone : telephone,
      adresse  : adresse
    }
    dispatch(await register(data, history))
  }



  return (<div> <Categorie /> <div className="col-sm-9 padding-right">:
    <div className="bill-to">
      <p>S'inscrire</p>
      <div className="form-one ">
        <form>
          <input type="text" placeholder="Email *" value={email} onChange={(e) => handleemail(e.target.value)} required />
          <input type="text" placeholder="S'identifier *" value={pseudo} onChange={(e) => handlepseudo(e.target.value)} required />
          <input type="password" placeholder="mot de passe * " value={password} onChange={(e) => handlepassword(e.target.value)} required />
          <select value={sexe} onChange={(e) => handlesexe(e.target.value)} required>
            <option>Homme</option>
            <option>Femme</option>
          </select>
          <p></p>
          <input type="text" placeholder="Nom *" value={nom} onChange={(e) => handlenom(e.target.value)} required />
          <input type="text" placeholder="Prenom *" value={prenom} onChange={(e) => handleprenom(e.target.value)} required />
          <input type="text" placeholder="Telephone *" value={telephone} onChange={(e) => handletelephone(e.target.value)} required />
          <input type="text" placeholder="Addresse *" value={adresse} onChange={(e) => handleadresse(e.target.value)} required />
          <input type="text" placeholder="Code Postal *" value={codePostal} onChange={(e) => handlecodePostal(e.target.value)} required />
          <input type="text" placeholder="Cin *" value={cin} onChange={(e) => handlecin(e.target.value)} required />
          <button className="btn btn-primary" onClick={handleSubmit}>S'inscrire</button>
        </form>
      </div>
    </div> </div> </div>);
}


export default Sinscrire;
